void UpdateMyLocal()
{
	g_Local.ent = g_Engine.GetLocalPlayer();
	g_Local.Death = IsLocalAlive(g_Local.ent);
	g_Local.vEye = g_Local.ppmove->origin + g_Local.ppmove->view_ofs;
	g_Engine.pEventAPI->EV_LocalPlayerViewheight(g_Local.pmEyePos);
	g_Local.pmEyePos[0] += g_Local.ppmove->origin[0];
	g_Local.pmEyePos[1] += g_Local.ppmove->origin[1];
	g_Local.pmEyePos[2] += g_Local.ppmove->origin[2];
	g_Local.vOrigin = g_Local.ppmove->origin;
	g_Local.flVelocity2D = g_Local.ppmove->velocity.Length2D();
	Vector vTemp1 = g_Local.ppmove->origin;
	vTemp1[2] -= 8192;
	pmtrace_t* trace = g_Engine.PM_TraceLine(g_Local.ppmove->origin, vTemp1, 1, g_Local.ppmove->usehull, -1);
	g_Local.flHeight = abs(trace->endpos.z - g_Local.ppmove->origin.z);
	if (g_Local.flHeight <= 60) g_Local.flGroundAngle = acos(trace->plane.normal[2]) / M_PI * 180;
	else g_Local.flGroundAngle = 0;
	Vector vTemp2 = trace->endpos;
	pmtrace_t pTrace;
	g_Engine.pEventAPI->EV_SetTraceHull(g_Local.ppmove->usehull);
	g_Engine.pEventAPI->EV_PlayerTrace(g_Local.ppmove->origin, vTemp2, PM_GLASS_IGNORE | PM_STUDIO_BOX, g_Local.ent->index, &pTrace);
	if (pTrace.fraction < 1.0f)
	{
		g_Local.flHeight = abs(pTrace.endpos.z - g_Local.ppmove->origin.z);
		int ind = g_Engine.pEventAPI->EV_IndexFromTrace(&pTrace);
		if (ind > 0 && ind < 33)
		{
			float dst = g_Local.ppmove->origin.z - (g_Local.ppmove->usehull == 0 ? 32 : 18) - g_LocalPlayer[ind].ent->origin.z - g_Local.flHeight;
			if (dst < 30)
			{
				g_Local.flHeight -= 14.0;
			}
		}
	}
	
}

void UpdateLocalPlayer()
{
	for (int i = 0; i < 33; i++)
	{
		g_LocalPlayer[i].ent = g_Engine.GetEntityByIndex(i);
		if (g_LocalPlayer[i].ent)
		{
			g_LocalPlayer[i].Death = true;
			g_LocalPlayer[i].name = (char*)(g_Vars.PlayerNamesAdr + (i - 1) * 976);
			g_LocalPlayer[i].HeadBone.x = *(float*)((DWORD)g_LocalPlayer[i].ent + 3192);
			g_LocalPlayer[i].HeadBone.y = *(float*)((DWORD)g_LocalPlayer[i].ent + 3192 + 16);
			g_LocalPlayer[i].HeadBone.z = *(float*)((DWORD)g_LocalPlayer[i].ent + 3192 + 32);
			BYTE DeathLoad = *(BYTE*)((DWORD)g_LocalPlayer[i].ent + 544);
			g_LocalPlayer[i].Death = IsPlayerDeath(g_LocalPlayer[i].ent);
			g_LocalPlayer[i].Refresh = *(int*)((DWORD)g_LocalPlayer[i].ent + 3176);
			g_LocalPlayer[i].IsValidEnt = IsValidEnt(g_LocalPlayer[i].ent);
			g_LocalPlayer[i].flFrametime = g_LocalPlayer[i].ent->curstate.animtime - g_LocalPlayer[i].ent->prevstate.animtime;
			if (g_LocalPlayer[i].flFrametime == NULL)
				g_LocalPlayer[i].flFrametime = g_Local.flFrametime;
			g_LocalPlayer[i].vOrigin = g_LocalPlayer[i].ent->curstate.origin;
			g_LocalPlayer[i].vVelocity = g_LocalPlayer[i].ent->curstate.origin - g_LocalPlayer[i].ent->prevstate.origin;
			//g_HitBox[i].HitBoxHeadID = CalcBestHitbox(i);
			//UpdateVisibility(i);
			/*
			if (DeathLoad != 0)
			{
				g_LocalPlayer[i].Death = false;
			}
			else
			{
				g_LocalPlayer[i].Death = true;
			}
			*/
			if (g_LocalPlayer[i].IsValidEnt == false)
			{
				g_LocalPlayer[i].Death = true;
			}
			if (!g_LocalPlayer[i].Death)
				g_LocalPlayer[i].flDist = g_LocalPlayer[i].vOrigin.Distance(g_Local.vOrigin);
		}
	}
	if (!g_Vars.LocalCheck)
		g_Vars.LocalCheck = true;
}

void ClearLocalPlayer(int i)
{
	g_LocalPlayer[i].Death = true;
	g_LocalPlayer[i].IsValidEnt = false;
	g_LocalPlayer[i].Visible = false;
	g_LocalPlayer[i].flFrametime = NULL;
	g_LocalPlayer[i].Team = 0;
}

bool IsPlayerDeath(struct cl_entity_s* ent)
{
	if (!g_LocalPlayer[ent->index].IsValidEnt)
		return true;

	if (Cstrike_SequenceInfo[ent->curstate.sequence] == 4 && !ent->curstate.weaponmodel)
		return true;

	return false;
}


void UpdateVisibility(int id)
{
	
	g_LocalPlayer[id].Visible = false;
	g_LocalPlayer[id].bBehindTheWall = true;
	deque<unsigned int> Hitboxes;
	for (unsigned int j = 0; j < g_HitBox[id].iMaxHitboxes; j++)
		Hitboxes.push_back(j);
	if (Hitboxes.empty())
		return;
	pmtrace_t tr;
	int detect = 0;
	for (auto&& hitbox : Hitboxes)
	{
		g_Engine.pEventAPI->EV_SetTraceHull(2);

		if (g_Vars.bypass_trace_blockers)
			g_Engine.pEventAPI->EV_PlayerTrace(g_Local.vEye, g_HitBox[id].vHitbox[hitbox], PM_WORLD_ONLY, -1, &tr);
		else
			g_Engine.pEventAPI->EV_PlayerTrace(g_Local.vEye, g_HitBox[id].vHitbox[hitbox], PM_GLASS_IGNORE, -1, &tr);
		detect = g_Engine.pEventAPI->EV_IndexFromTrace(&tr);
		if ((g_Vars.bypass_trace_blockers && tr.fraction == 1 && !detect) || (!g_Vars.bypass_trace_blockers && detect == id))
		{
			g_LocalPlayer[id].Visible = true;
			g_LocalPlayer[id].bBehindTheWall = false;
			g_HitBox[id].bHitboxVisible[hitbox] = true;
			g_HitBox[id].bHitboxBehindTheWall[hitbox] = false;
		}
		else {
			g_HitBox[id].bHitboxVisible[hitbox] = false;
			g_HitBox[id].bHitboxBehindTheWall[hitbox] = false;
		}
	}
}

int CalcBestHitbox(int id)
{
	float bestHeight, bestDist = 0.f;
	int highestHitboxes[2] = { -1, -1 }, result;

	if (id == -1)
		return 0;

	bestHeight = g_Engine.GetEntityByIndex(id)->origin.z;

	for (int a = 1; a < 12; a++)
	{
		if (g_HitBox[id].vHitbox[a].z > bestHeight)
		{
			highestHitboxes[1] = highestHitboxes[0];
			highestHitboxes[0] = a;
			bestHeight = g_HitBox[id].vHitbox[a].z;
		}
	}

	if (highestHitboxes[0] == -1) return 0;

	for (int i = 0; i < 2; i++)
	{
		if (highestHitboxes[i] == -1)
			continue;

		float x = g_LocalPlayer[i].vOrigin.x - g_HitBox[i].vHitbox[highestHitboxes[i]].x;
		float y = g_LocalPlayer[i].vOrigin.y - g_HitBox[i].vHitbox[highestHitboxes[i]].y;
		float dist = sqrt(pow(x, 2) + pow(y, 2));
		if (bestDist == 0.f) bestDist = dist;

		if (dist <= bestDist)
		{
			bestDist = dist;
			result = highestHitboxes[i];
		}
	}
	//Engine.Con_Printf("ID - %i, Hitbox - %i, Coord - %1.0f, %1.0f, %1.0f\n", target, result, Player[target].Hitbox[result].x, Player[target].Hitbox[result].y, Player[target].Hitbox[result].z);
	return result;
}

bool IsValidEnt(cl_entity_s* ent)
{
	if ((ent->index != g_Engine.GetLocalPlayer()->index) && !(ent->curstate.effects & EF_NODRAW) && ent->player && (ent->model->name != 0 || ent->model->name != "") && !(ent->curstate.messagenum < g_Engine.GetLocalPlayer()->curstate.messagenum) && ent->curstate.movetype != 6 && ent->curstate.movetype != 0)
		return true;
	else
		return false;
}

bool IsLocalAlive(cl_entity_s* pLocal)
{
	if ((pLocal->curstate.iuser1 == 0)
		&& (g_Local.Team == 1 || g_Local.Team == 2)
		&& (g_Local.ppmove->view_ofs[2] != -8))
		return false;
	else
		return true;
}

bool IsVisibleEnt(float* pflFrom, float* pflTo)
{
	if (!pflFrom || !pflTo) { return false; }
	pmtrace_t pTrace;
	g_Engine.pEventAPI->EV_SetTraceHull(2);
	g_Engine.pEventAPI->EV_PlayerTrace(pflFrom, pflTo, PM_STUDIO_IGNORE | PM_GLASS_IGNORE | PM_STUDIO_BOX, g_Local.ent->index, &pTrace);
	return (pTrace.fraction == 1.0f);
}

float Get3DDistance(float* self, float* obj)
{
	float d = (obj[0] - self[0]) * (obj[0] - self[0]) + (obj[1] - self[1]) * (obj[1] - self[1]) + (obj[2] - self[2]) * (obj[2] - self[2]);
	return (sqrt(d));
}
